  static String applyBruteForce (String URL, String UserName)
  {



      String strPass = "";

      char ch1, ch2, ch3;

      System.out.print("


 Applying BruteForce Attack:     ");

      for (ch1 = 'A' ; ch1 <= 'z' ; ch1 ++)
      {
          if ( ch1 > 'Z' && ch1 < 'a' )
              ch1 = 'a';

          for (ch2 = 'A' ; ch2 <= 'z' ; ch2 ++)
